import React, { useState, useEffect } from 'react';
import ReactSlider from 'react-slider';
import styled from 'styled-components';

const SlideContainer = styled.div`
  width: 100%;
`;

const SliderTrack = styled.div`
  height: 25px;
  background: #d3d3d3;
  border-radius: 5px;
  position: relative;
`;

const SliderThumb = styled.div`
  width: 25px;
  height: 25px;
  background: #04AA6D;
  border-radius: 50%;
  cursor: pointer;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  /* Custom styling for Webkit */
  -webkit-appearance: none;
`;

const RangeValues = styled.div`
  display: flex;
  justify-content: space-between;
  font-size: 14px;
  margin-top: 10px;
`;

const Slider = ({ universities, onRangeChange }) => {
  const [percentileRange, setPercentileRange] = useState([0, 100]);

  useEffect(() => {
    if (universities.length > 0) {
      const percentiles = universities.map((college) => Math.floor(college.percentile));
      const minPercentile = Math.min(...percentiles);
      const maxPercentile = Math.max(...percentiles);
      setPercentileRange([minPercentile, maxPercentile]);
    }
  }, [universities]);

  useEffect(() => {
    onRangeChange(percentileRange);
  }, [percentileRange, onRangeChange]);

  return (
    <SlideContainer>
      <ReactSlider
        min={percentileRange[0]}
        max={percentileRange[1]}
        value={percentileRange}
        onChange={(range) => setPercentileRange(range)}
        renderTrack={(props) => <SliderTrack {...props} />}
        renderThumb={(props) => <SliderThumb {...props} />}
      />
      <RangeValues>
        <span>{percentileRange[0]}</span>
        <span>{percentileRange[1]}</span>
      </RangeValues>
    </SlideContainer>
  );
};

export default Slider;
